import React from 'react';
import { BrowserRoute } from 'react-router';
import Login from './services/pages/Login';


class App extends React.Component {
  render() {
    return (
    <BrowserRoute>
      <Route path="/" component={Login} />
    </BrowserRoute>
    )
  }
}

export default App;
